<!DOCTYPE html>
<html>

<head>
  <title>preview-wiki-osu</title>
  <link href="assets/css/materialdesignicons.css" rel="stylesheet"/>
  <link href="assets/css/index.css" rel="stylesheet"/>

  <script>
    window.nodeRequire = require;
    delete window.require;
    delete window.exports;
    delete window.module;
  </script>
</head>

<body>
  <div id="loading">
  </div>
  <div id="toolbar">
    <i id="toolbar-backward" data-icon="arrow-left"></i>
    <i id="toolbar-forward" data-icon="arrow-right"></i>
    <i id="toolbar-refresh" data-icon="refresh"></i>
    <i id="toolbar-upload" data-icon="upload"></i>
    <input id="toolbar-path" data-value="" type="text"/>
    <i id="toolbar-menu" data-icon="menu"></i>
    <div id="toolbar-menu-list" data-hidden>
      <div class="item">
        <i data-icon="login-variant"></i>
        <span>What links here?</span>
      </div>
      <div class="item">
        <i data-icon="logout-variant"></i>
        <span>Here links where?</span>
      </div>
    </div>
  </div>
  <div id="pseudo"></div>
  <div id="wiki">
    <div id="wiki-header">
      <div id="wiki-header-title-box">
        <h2 id="wiki-header-subtitle"></h2>
        <h1 id="wiki-header-title"></h1>
      </div>
    </div>
    <div id="wiki-body">
      <div id="wiki-body-toc">
        <div id="wiki-body-toc-content">
          <div id="wiki-body-toc-content-header">
            Contents
          </div>
          <ol id="wiki-body-toc-list"></ol>
        </div>
      </div>
      <div id="wiki-body-content"></div>
    </div>
  </div>
  <div id="notify" data-hidden>
    <div id="notify-message"></div>
  </div>
  <script src="index.js"></script>
</body>

</html>
